import React, {Component} from 'react';

class HighScore extends Component {

    render(){

        if(this.props.overTen){
            return (
                <h3>You beat 10!
                    <button onClick={(e) => this.props.onReset(e)}></button>
                </h3> 
            )
        } else {
            return null;
        }
    }
}

export default HighScore;
